  input: 'TEXT,"F3A","","The policy of the King for Congress Campaign with regard
    to obtained contributions that lack the appropriate occupation/employer information
    is as follows:  1) In all fundraising solicitations, it is stated in the letter
    that federal law requires the King for Congress campaign to report the name, mailing
    address, occupation and employer for all individuals whose contributions aggregate
    in excess of $200 in a calendar year.  2)  If a contribution is received without
    the appropriate information, a phone number is obtained and the contributor is
    phoned within 5 days of the receipt of the check and is asked to provide the missing
    required information.  If a phone number can not be obtained, the contributor
    is sent a letter within 5 days of the receipt of the check and is specifically
    asked in the outset of the letter to supply the missing information that is required
    by federal law.  The letter is accompanied by a return envelope that is designed
    to gather the information required.  The follow-up letter does not in any way
    attempt to solicit a further contribution.  3)  If occupation and employer information
    is obtained after the date with which the information must be filed with the FEC,
    the campaign treasurer was informed and an amendment to the report was filed with
    the additional contributor information enclosed."'
